const produceList = [
    {
        "id": 1,
        "name": "Apple",
        "image": "apple.jpg", // the path to the image file
        "price": 1.20,
        "quantity": 25
    },
    {
        "id": 2,
        "name": "Banana",
        "image": "banana.jpg", // the path to the image file
        "price": 0.80,
        "quantity": 30
    },
    {
        "id": 3,
        "name": "Orange",
        "image": "orange.jpg", // the path to the image file
        "price": 0.90,
        "quantity": 20
    },
    {
        "id": 4,
        "name": "Grapes",
        "image": "grapes.jpg", // the path to the image file
        "price": 2.50,
        "quantity": 15
    }
]

function ProduceList() {
    return (
        <>
            <div className="produce__list">
            {produceList.map(item => (
                <div className="produce__item" key={item.id}>
                    <img src={item.image} alt={item.name} />
                    <h2>{item.name}</h2>
                    <p>${item.price} / lb</p>
                    <button>Add to Cart</button>
                    </div>
            ))}
            </div>
        </>
    )
}
export default ProduceList;
